import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import MenuList from '@mui/material/MenuList';
const Nav=()=>{
return (
    <>
    <nav className="navbar bg-dark text-white">
        <MenuList className/>
    <img class="nav-item gb_Hc gb_de" src="https://www.gstatic.com/images/branding/product/1x/keep_2020q4_48dp.png" srcset="https://www.gstatic.com/images/branding/product/1x/keep_2020q4_48dp.png 1x, https://www.gstatic.com/images/branding/product/2x/keep_2020q4_48dp.png 2x " alt="" aria-hidden="true" role="presentation" style={{width:"40px",height:"40px"}}/>
    <div className="nav-item">this is navbar</div>
    </nav>
    </>
)
}
export default Nav;
